// P치gina de inicio o bienvenida con:
// * Imagen de fondo representativa al proyecto.
// * Bot칩n para ingresar a la home page.

import './Landing.css';
import { React, useEffect } from 'react';
import * as actions from '../../redux/actions';
import { useDispatch, useSelector } from 'react-redux';

export default function Landing(props) {
    const dispatch = useDispatch();

    useEffect(() => {
        const dogTemps = useSelector(store => store.temperaments)
        if (!dogTemps) dispatch(actions.getAllTemperaments())
    })

    return (
        <div className="landing">
            <div className="welcome">
                <h1 className="message">Welcome to Henry Dogs</h1>
                <button className="start" onClick={() => { props.getStarted() }}>Show Me!</button>
                <div className="bottom">Project by Cecilia Moroni for Henry <img src='https://pbs.twimg.com/profile_images/1542845396032135168/o5AmaQyh_400x400.jpg' alt='logoHenry' className='logoHenry' /></div>
            </div>
        </div>
    )
}
